window.bookSummaryJSON = "<p><b>From the author of </b><b><i>Mountain Man</i></b><b>: Encounter a new breed of fear in the first book of a bloodcurdling werewolf horror series set in the snows of Newfoundland.</b></p> <p>In a nearly deserted village off the coast of Canada, strange things are happening. A local hunter discovers bare footprints in the snow. The stray dog population has ceased to exist. And people are beginning to ask questions about the town’s recluse.</p> <p>But with winter’s most powerful weapon bearing down on the island, it’s about to get a lot worse . . .</p> <p><i>Breeds</i> is the first book in a trilogy of terror sure to please fans of Robert R. McCammon, Maggie Stiefvater, and Chase Novak.</p>"; 
